import{_ as a,o as e,c as t,V as s}from"./chunks/framework.d3b95951.js";const g=JSON.parse('{"title":"指令列表","description":"","frontmatter":{},"headers":[],"relativePath":"guide/useful-commands.md","filePath":"guide/useful-commands.md","lastUpdated":1689507063000}'),o={name:"guide/useful-commands.md"},l=s('<h1 id="指令列表" tabindex="-1">指令列表 <a class="header-anchor" href="#指令列表" aria-label="Permalink to &quot;指令列表&quot;">​</a></h1><p>本章节介绍了 ChatHub 提供的所有命令，以及它们的用法和参数。</p><p>这些命令可以在聊天中使用，控制和配置 ChatHub 的各种功能。</p><p>你可以查看右侧的目录，快速找到你想要了解或使用的的命令。</p><h2 id="交互式对话" tabindex="-1">交互式对话 <a class="header-anchor" href="#交互式对话" aria-label="Permalink to &quot;交互式对话&quot;">​</a></h2><p>交互式对话是用户和 ChatHub 交互的主要方式，用户可以通过输入文本来和 ChatHub 进行对话，ChatHub 会根据用户的输入和当前的聊天模式与模型，让模型生成回复，并发送给用户。</p><h3 id="和模型对话" tabindex="-1">和模型对话 <a class="header-anchor" href="#和模型对话" aria-label="Permalink to &quot;和模型对话&quot;">​</a></h3><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.chat</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&lt;</span><span style="color:#C3E88D;">message:tex</span><span style="color:#A6ACCD;">t</span><span style="color:#89DDFF;">&gt;</span></span></code></pre></div><p>和模型进行对话。</p><p>执行后会根据用户的输入和当前的聊天模式与模型，让模型生成回复，并发送给用户。如</p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.chat</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">你是？</span></span></code></pre></div><p>参数 <code>message</code>，表示要发送给模型的文本内容。如果文本内容为空或无效，会返回一个错误信息。</p><p>还有以下可选参数应用于此命令：</p><table><thead><tr><th>参数</th><th>说明</th><th>权限</th></tr></thead><tbody><tr><td>-c &lt;chatMode:string&gt;</td><td>聊天模式，如 <code>chat</code>,<code>plugin</code>,<code>browsing</code></td><td>1</td></tr><tr><td>-m &lt;model:string&gt;</td><td>使用的模型，如 <code>openai/gpt-3.5-turbo</code>,<code>claude2/claude2</code></td><td>1</td></tr></tbody></table><p>你也可以使用别名 <code>聊天</code> 命令来替代 <code>chathub.chat</code>。</p><h3 id="语音聊天" tabindex="-1">语音聊天 <a class="header-anchor" href="#语音聊天" aria-label="Permalink to &quot;语音聊天&quot;">​</a></h3><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.voice</span><span style="color:#A6ACCD;"> [model:string] </span><span style="color:#89DDFF;">&lt;</span><span style="color:#A6ACCD;">message:text</span><span style="color:#89DDFF;">&gt;</span></span></code></pre></div><p>和模型进行对话并输出为语音。</p><p>执行后会根据用户的输入和当前的聊天模式与模型，让模型生成回复，并调用语音服务将其转换为语音文件，发送给用户。如：</p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.voice</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">芝士雪豹</span></span></code></pre></div><p>该子命令有两个参数:</p><p>参数 <code>message</code>，表示要发送给模型的文本内容。如果文本内容为空或无效，会返回一个错误信息。 参数 <code>model</code>，表示要切换到的模型名称。如果不使用该参数，则使用设置的默认模型。</p><p>还有以下可选参数应用于此命令：</p><table><thead><tr><th>参数</th><th>说明</th><th>权限</th></tr></thead><tbody><tr><td>-c &lt;chatMode:string&gt;</td><td>选择聊天模式，同上</td><td>1</td></tr><tr><td>-s &lt;speakerId:number&gt;</td><td>语音服务的目标人物的ID，如 114</td><td>1</td></tr></tbody></table><p>你也可以使用别名 <code>语音聊天</code> 命令来替代 <code>chathub.voice</code>。</p><h2 id="会话管理" tabindex="-1">会话管理 <a class="header-anchor" href="#会话管理" aria-label="Permalink to &quot;会话管理&quot;">​</a></h2><p>会话管理是 ChatHub 的一个重要功能，它可以删除某个会话，重置会话聊天记录等。</p><h3 id="查询会话" tabindex="-1">查询会话 <a class="header-anchor" href="#查询会话" aria-label="Permalink to &quot;查询会话&quot;">​</a></h3><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.queryconverstion</span><span style="color:#A6ACCD;"> [model:string]</span></span></code></pre></div><p>查询会话列表。</p><p>执行后会显示所有与执行此命令的用户相关的会话及其信息。如：</p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.queryconverstion</span></span></code></pre></div><p>参数 <code>model</code>，表示要查询的模型名称。如果不指定，则查询所有模型的会话。</p><p>还有以下可选参数应用于此命令：</p><table><thead><tr><th>参数</th><th>说明</th><th>权限</th></tr></thead><tbody><tr><td>-m &lt;model:string&gt;</td><td>目标模型，如 <code>openai/gpt-3.5-turbo</code>,<code>claude2/claude2</code></td><td>1</td></tr><tr><td>-c &lt;chatMode:string&gt;</td><td>目标聊天模式，如 <code>chat</code>,<code>plugin</code>,<code>browsing</code></td><td>1</td></tr></tbody></table><p>你也可以使用别名 <code>会话列表</code> 命令用来替代 <code>chathub.queryconverstion</code>。</p><h3 id="删除会话" tabindex="-1">删除会话 <a class="header-anchor" href="#删除会话" aria-label="Permalink to &quot;删除会话&quot;">​</a></h3><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.deleteconverstaion</span><span style="color:#A6ACCD;"> [id:string]</span></span></code></pre></div><p>删除会话。</p><p>执行后会根据指定的会话 ID，从数据库中删除对应的会话记录。如：</p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.deleteconverstaion</span><span style="color:#A6ACCD;"> </span><span style="color:#F78C6C;">3</span><span style="color:#C3E88D;">C404694-9F5C-1C6D-9F0F-9D6CA125D51E</span></span></code></pre></div><p>参数 id 表示要删除的会话 ID。这是一个必须参数。</p><p>目前的会话 ID 使用 uuid v4 生成，因此会话 ID 的格式为 uuid v4 的格式，如 <code>3C404694-9F5C-1C6D-9F0F-9D6CA125D51E</code>。</p><p>你也可以使用 <code>删除会话</code> 命令来替代 <code>chathub.deleteconverstaion</code>。</p><h3 id="删除所有会话" tabindex="-1">删除所有会话 <a class="header-anchor" href="#删除所有会话" aria-label="Permalink to &quot;删除所有会话&quot;">​</a></h3><p>用于删除和执行此命令用户相关的所有会话，需要至少 3 级权限。执行后会从数据库中删除所有与当前用户相关的会话记录。如：</p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.deleteallconverstaion</span></span></code></pre></div><p>你也可以使用别名 <code>删除所有会话</code> 命令来替代 <code>chathub.deleteallconverstaion</code>。</p><h3 id="重置会话" tabindex="-1">重置会话 <a class="header-anchor" href="#重置会话" aria-label="Permalink to &quot;重置会话&quot;">​</a></h3><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.reset</span><span style="color:#A6ACCD;"> [model:string]</span></span></code></pre></div><p>用于重置当前使用会话记录。如：</p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.reset</span></span></code></pre></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>此命令不会重置长期记忆。</p></div><p>参数 <code>model</code>，表示要重置的会话的模型名称。如果不使用，则保持当前默认的模型。</p><p>还有以下可选参数，这些参数用于约束所重置的会话的范围：</p><table><thead><tr><th>参数</th><th>说明</th><th>权限</th></tr></thead><tbody><tr><td>-c &lt;chatMode:string&gt;</td><td>目标聊天模式，如 <code>chat</code>,<code>plugin</code>,<code>browsing</code></td><td>1</td></tr></tbody></table><p>你也可以使用别名 <code>重置会话</code> 命令来替代 <code>chathub.reset</code>。</p><h2 id="模型管理" tabindex="-1">模型管理 <a class="header-anchor" href="#模型管理" aria-label="Permalink to &quot;模型管理&quot;">​</a></h2><p>模型管理是 ChatHub 的一个重要功能，它可以列出所有支持的模型，切换当前使用的模型等。</p><h3 id="模型列表" tabindex="-1">模型列表 <a class="header-anchor" href="#模型列表" aria-label="Permalink to &quot;模型列表&quot;">​</a></h3><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.listmodel</span></span></code></pre></div><p>用于列出所有目前支持的模型。执行后会返回一个列表，显示所有可用的模型。如：</p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.listmodel</span></span></code></pre></div><p>关于模型，详见<a href="/guide/configure-model-platform/introduction.html">模型平台</a></p><p>该子命令还有一个别名 <code>模型列表</code>，可以用来替代 <code>chathub.listmodel</code>。</p><h3 id="设置模型" tabindex="-1">设置模型 <a class="header-anchor" href="#设置模型" aria-label="Permalink to &quot;设置模型&quot;">​</a></h3><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.setmodel</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&lt;</span><span style="color:#C3E88D;">mode</span><span style="color:#A6ACCD;">l</span><span style="color:#89DDFF;">&gt;</span></span></code></pre></div><p>该子命令用于设置当前群聊/私聊默认使用的模型，需要至少 1 级权限。执行后会根据指定的模型名称，修改默认模型配置。</p><p>该子命令有一个必选参数 <code>&lt;model&gt;</code>，表示要切换到的模型名称。如果不存在该名称的模型，会返回错误信息。</p><p>该子命令还有以下可选参数:</p><table><thead><tr><th>参数</th><th>说明</th><th>权限</th></tr></thead><tbody><tr><td>-g</td><td>也设置为全局默认的模型。如果指定了该参数，则所有新建的会话都会使用该模型</td><td>1</td></tr></tbody></table><p>该子命令还有一个别名 <code>切换模型</code>，可以用来替代 <code>chathub.setmodel</code>。</p><h2 id="嵌入模型和向量数据库管理" tabindex="-1">嵌入模型和向量数据库管理 <a class="header-anchor" href="#嵌入模型和向量数据库管理" aria-label="Permalink to &quot;嵌入模型和向量数据库管理&quot;">​</a></h2><h3 id="列出嵌入模型" tabindex="-1">列出嵌入模型 <a class="header-anchor" href="#列出嵌入模型" aria-label="Permalink to &quot;列出嵌入模型&quot;">​</a></h3><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.listembeddings</span></span></code></pre></div><p>该子命令用于列出所有目前支持的嵌入模型，需要至少 1 级权限。</p><p>有关嵌入模型的详细信息，请参见<a href="/guide/configure-embedding-model/introduction.html">嵌入模型</a></p><p>该子命令没有参数，执行后会返回一个列表，显示所有可用的嵌入模型及其简介。</p><p>该子命令还有一个别名 <code>嵌入模型列表</code>，可以用来替代 <code>chathub.listembeddings</code>。</p><h3 id="列出向量数据库" tabindex="-1">列出向量数据库 <a class="header-anchor" href="#列出向量数据库" aria-label="Permalink to &quot;列出向量数据库&quot;">​</a></h3><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.listvectorStore</span></span></code></pre></div><p>该子命令用于列出所有目前支持的向量数据库，需要至少 1级权限。</p><p>有关向量数据库的详细信息，请参见<a href="/guide/configure-vector-store/introduction.html">向量数据库</a></p><p>该子命令没有参数，执行后会返回一个列表，显示所有可用的向量数据库及其简介。</p><p>该子命令还有一个别名 <code>向量数据库列表</code>，可以用来替代 <code>chathub.listvectorStore</code>。</p><h3 id="设置默认嵌入模型" tabindex="-1">设置默认嵌入模型 <a class="header-anchor" href="#设置默认嵌入模型" aria-label="Permalink to &quot;设置默认嵌入模型&quot;">​</a></h3><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.setembeddings</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&lt;</span><span style="color:#C3E88D;">embeddings:strin</span><span style="color:#A6ACCD;">g</span><span style="color:#89DDFF;">&gt;</span></span></code></pre></div><p>该子命令用于设置默认使用的嵌入模型，需要至少 1 级权限。执行后会根据指定的嵌入模型名称，修改聊天链的配置，并重置聊天状态。</p><p>该子命令有一个必选参数 <code>&lt;embeddings:string&gt;</code>，表示要切换到的嵌入模型名称。如果不存在该名称的嵌入模型，会返回一个错误信息。</p><p>该子命令还有一个别名 <code>设置嵌入模型</code>，可以用来替代 <code>chathub.setembeddings</code>。</p><h3 id="设置默认向量数据库" tabindex="-1">设置默认向量数据库 <a class="header-anchor" href="#设置默认向量数据库" aria-label="Permalink to &quot;设置默认向量数据库&quot;">​</a></h3><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.setvectorstore</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&lt;</span><span style="color:#C3E88D;">vectorStore:strin</span><span style="color:#A6ACCD;">g</span><span style="color:#89DDFF;">&gt;</span></span></code></pre></div><p>该子命令用于设置默认使用的向量数据库，需要至少 1 级权限。执行后会根据指定的向量数据库名称，修改聊天链的配置，并重置聊天状态。</p><p>该子命令有一个必选参数 <code>&lt;vectorStore:string&gt;</code>，表示要切换到的向量数据库名称。如果不存在该名称的向量数据库，会返回一个错误信息。</p><p>该子命令还有一个别名 <code>设置向量数据库</code>，可以用来替代 <code>chathub.setvectorstore</code>。</p><h2 id="预设管理" tabindex="-1">预设管理 <a class="header-anchor" href="#预设管理" aria-label="Permalink to &quot;预设管理&quot;">​</a></h2><h3 id="预设列表" tabindex="-1">预设列表 <a class="header-anchor" href="#预设列表" aria-label="Permalink to &quot;预设列表&quot;">​</a></h3><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.listpreset</span></span></code></pre></div><p>该子命令用于列出所有目前支持的预设，需要至少 1 级权限。预设是一组聊天链的参数，包括聊天模式、模型名称等，可以方便地切换不同的聊天场景。</p><p>该子命令没有参数，执行后会返回一个列表，显示所有可用的预设及其对应的参数。</p><p>该子命令还有一个别名 <code>预设列表</code>，可以用来替代 <code>chathub.listpreset</code>。</p><h3 id="设置预设" tabindex="-1">设置预设 <a class="header-anchor" href="#设置预设" aria-label="Permalink to &quot;设置预设&quot;">​</a></h3><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.setpreset</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&lt;</span><span style="color:#C3E88D;">preset:strin</span><span style="color:#A6ACCD;">g</span><span style="color:#89DDFF;">&gt;</span></span></code></pre></div><p>该子命令用于设置当前使用的预设，需要至少 1 级权限。执行后会根据指定的预设名称，修改聊天链的参数，并重置聊天状态。</p><p>该子命令有一个必选参数 <code>&lt;preset:string&gt;</code>，表示要切换到的预设名称。如果不存在该名称的预设，会返回一个错误信息。</p><p>该子命令还有以下可选参数:</p><table><thead><tr><th>参数</th><th>说明</th><th>权限</th></tr></thead><tbody><tr><td>-c &lt;chatMode:string&gt;</td><td>选择聊天模式，可以是 <code>Balanced</code>、<code>Creative</code> 或 <code>Precise</code></td><td>1</td></tr><tr><td>-m &lt;model:string&gt;</td><td>切换的目标模型，可以是 <code>chatgpt</code>、<code>chatgpt2</code> 或 <code>chatgpt3</code></td><td>1</td></tr><tr><td>-g</td><td>也设置为全局会话默认的预设？如果指定了该参数，则所有新建的会话都会使用该预设</td><td>1</td></tr></tbody></table><p>该子命令还有一个别名 <code>切换预设</code>，可以用来替代 <code>chathub.setpreset</code>。</p><h3 id="重置预设" tabindex="-1">重置预设 <a class="header-anchor" href="#重置预设" aria-label="Permalink to &quot;重置预设&quot;">​</a></h3><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.resetpreset</span><span style="color:#A6ACCD;"> [model:string]</span></span></code></pre></div><p>该子命令用于重置为默认使用的预设（chatgpt预设），需要至少 1 级权限。执行后会将聊天链的参数恢复为默认值，并重置聊天状态。</p><p>该子命令有一个可选参数 <code>[model:string]</code>，表示要重置为的模型名称。如果不指定，则默认为 <code>chatgpt</code>。</p><p>该子命令还有以下可选参数:</p><table><thead><tr><th>参数</th><th>说明</th><th>权限</th></tr></thead><tbody><tr><td>-c &lt;chatMode:string&gt;</td><td>选择聊天模式，可以是 <code>Balanced</code>、<code>Creative</code> 或 <code>Precise</code></td><td>1</td></tr></tbody></table><p>该子命令还有一个别名 <code>重置预设</code>，可以用来替代 <code>chathub.resetpreset</code>。</p><h3 id="添加预设" tabindex="-1">添加预设 <a class="header-anchor" href="#添加预设" aria-label="Permalink to &quot;添加预设&quot;">​</a></h3><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.addpreset</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&lt;</span><span style="color:#C3E88D;">preset:strin</span><span style="color:#A6ACCD;">g</span><span style="color:#89DDFF;">&gt;</span></span></code></pre></div><p>该子命令用于添加一个预设，需要至少 1 级权限。执行后会根据当前聊天链的参数，创建一个新的预设，并保存到配置文件中。</p><p>该子命令有一个必选参数 <code>&lt;preset:string&gt;</code>，表示要添加的预设名称。如果已存在同名的预设，会返回一个错误信息。</p><p>该子命令没有可选参数。</p><p>该子命令还有一个别名 <code>添加预设</code>，可以用来替代 <code>chathub.addpreset</code>。</p><h3 id="删除预设" tabindex="-1">删除预设 <a class="header-anchor" href="#删除预设" aria-label="Permalink to &quot;删除预设&quot;">​</a></h3><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.deletepreset</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&lt;</span><span style="color:#C3E88D;">preset:strin</span><span style="color:#A6ACCD;">g</span><span style="color:#89DDFF;">&gt;</span></span></code></pre></div><p>该子命令用于删除一个预设，需要至少 1 级权限。执行后会根据指定的预设名称，从配置文件中删除对应的预设，并重置聊天状态。</p><p>该子命令有一个必选参数 <code>&lt;preset:string&gt;</code>，表示要删除的预设名称。如果不存在该名称的预设，会返回一个错误信息。</p><p>该子命令没有可选参数。</p><p>该子命令还有一个别名 <code>删除预设</code>，可以用来替代 <code>chathub.deletepreset</code>。</p><h2 id="数据管理" tabindex="-1">数据管理 <a class="header-anchor" href="#数据管理" aria-label="Permalink to &quot;数据管理&quot;">​</a></h2><h3 id="双清" tabindex="-1">双清 <a class="header-anchor" href="#双清" aria-label="Permalink to &quot;双清&quot;">​</a></h3><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.wipe</span></span></code></pre></div><p>该子命令用于清空 chathub 的所有使用数据，需要至少 3 级权限。执行后会删除数据库中的所有会话记录、预设配置、向量数据库等数据，并重置聊天状态。</p><p>该子命令还有一个别名 <code>双清 chathub</code>，可以用来替代 <code>chathub.wipe</code>。</p><h3 id="列出聊天模式" tabindex="-1">列出聊天模式 <a class="header-anchor" href="#列出聊天模式" aria-label="Permalink to &quot;列出聊天模式&quot;">​</a></h3><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">chathub.listchatmode</span></span></code></pre></div><p>该子命令用于列出目前支持的聊天模式，需要至少 1 级权限。</p><p>有关 ChatHub 的聊天模式，详见<a href="/guide/chat-mode-and-output-mode.html">聊天模式</a></p><p>该子命令没有参数，执行后会返回一个列表，显示所有可用的聊天模式及其简介。</p><p>该子命令还有一个别名 <code>聊天模式列表</code>，可以用来替代 <code>chathub.listchatmode</code>。</p><h2 id="参考" tabindex="-1">参考 <a class="header-anchor" href="#参考" aria-label="Permalink to &quot;参考&quot;">​</a></h2><ul><li><a href="https://koishi.chat/zh-CN/manual/usage/permission.html#%E7%94%A8%E6%88%B7%E6%9D%83%E9%99%90" target="_blank" rel="noreferrer">权限系统</a></li></ul>',140),c=[l];function p(n,d,h,r,i,u){return e(),t("div",null,c)}const C=a(o,[["render",p]]);export{g as __pageData,C as default};
